import React from 'react';
import '../css/about.css'; 

function About() {
  return (
    <div className="about-container">
      <h1>Welcome to Travel Tribe</h1>
      <p>
        At Travel Tribe, we believe in the power of exploration and connection. 
        Join us to discover new places, meet like-minded travelers, and create unforgettable memories.
      </p>
    </div>
  );
}

export default About;
